<p>在 2022 年 8 月份，我向<a href="https://github.com/YunYouJun" target="_blank" rel="noreferrer">云游君</a>的 hexo 主题 <a href="https://github.com/YunYouJun/hexo-theme-yun" target="_blank" rel="noreferrer">hexo-theme-yun</a> 提 issue 的时候，他向我提到了 <a href="https://valaxy.site/" target="_blank" rel="noreferrer">valaxy</a> 这个由他开发的静态博客框架。当时 valaxy 十分先进的技术栈和一些优良特性一下就吸引了我，但是由于我已经使用 hexo 写了很多文章，且 valaxy 也没有迁移文档/工具，所以那时我并没有迁移。</p>
